    useFrame(state => (boxRef.current.rotation.x += 0.005))*/

    return (
        <mesh>
            <boxGeometry args={[3,3,3]}/>
            <RenderTexture>
                <color attach="background" args={["#D6F42A"]}/>
            </RenderTexture>
        </mesh>
    )
}
